import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css'; // Import global styles

// Import your page components
import Home from './components/Home';
import Login from './components/Login';
import Register from './components/Register';
import AboutUs from './components/AboutUs';
import Profile from './components/Profile';
import Consultation from './components/Consultation';
import DoctorRegistration from './components/DoctorRegistration';
import HospitalRecords from './components/HospitalRecords';

function App() {
  return (
    <Router>
      <div>
        <header>
          <div className="logo">
            <i className="fa-solid fa-map-location"></i>
            <h1>Hospital Directory</h1>
          </div>
          <nav>
            <ul>
              <li><a href="/">Home</a></li>
              <li><a href="/login">Log In</a></li>
              <li><a href="/register">Register</a></li>
              <li><a href="/about">About Us</a></li>
              <li><a href="/profile">Profile</a></li>
              <li><a href="/consultation">Consultation</a></li>
              <li><a href="/doctor-registration">Doctor Registration</a></li>
              <li><a href="/hospital-records">Hospital Records</a></li>
            </ul>
          </nav>
        </header>
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/about" element={<AboutUs />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/consultation" element={<Consultation />} />
            <Route path="/doctor-registration" element={<DoctorRegistration />} />
            <Route path="/hospital-records" element={<HospitalRecords />} />
          </Routes>
        </main>
        <footer>
          <p>A website designed to help users easily find hospitals nearby...</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
